/*
 *  Constructs a CQSplashWidget which is a child of 'parent', with the
 *  name 'name'.'
 */
CQSplashWidget::CQSplashWidget(QWidget* parent, const char* name)
    : CopasiWidget(parent, name),
    image0((const char **) image0_data)
{
  if (!name)
    setName("CQSplashWidget");
  setPaletteBackgroundColor(QColor(255, 255, 255));
  CQSplashWidgetLayout = new QVBoxLayout(this, 11, 6, "CQSplashWidgetLayout");

  mpPixmap = new QLabel(this, "mpPixmap");
  mpPixmap->setPaletteBackgroundColor(QColor(255, 255, 255));
  mpPixmap->setPixmap(image0);
  mpPixmap->setScaledContents(FALSE);
  mpPixmap->setAlignment(int(QLabel::AlignCenter));
  CQSplashWidgetLayout->addWidget(mpPixmap);

  mpLblVersion = new QLabel(this, "mpLblVersion");
  mpLblVersion->setAlignment(int(QLabel::WordBreak | QLabel::AlignCenter));
  CQSplashWidgetLayout->addWidget(mpLblVersion);
  mpSpacer = new QSpacerItem(20, 16, QSizePolicy::Minimum, QSizePolicy::Expanding);
  CQSplashWidgetLayout->addItem(mpSpacer);

  mpLayoutLicense = new QHBoxLayout(0, 0, 6, "mpLayoutLicense");

  mpLblLicense = new QLabel(this, "mpLblLicense");
  mpLblLicense->setSizePolicy(QSizePolicy((QSizePolicy::SizeType)7, (QSizePolicy::SizeType)5, 0, 0, mpLblLicense->sizePolicy().hasHeightForWidth()));
  mpLblLicense->setAlignment(int(QLabel::WordBreak | QLabel::AlignVCenter));
  mpLayoutLicense->addWidget(mpLblLicense);

  mpBtnLicense = new QPushButton(this, "mpBtnLicense");
  mpLayoutLicense->addWidget(mpBtnLicense);
  CQSplashWidgetLayout->addLayout(mpLayoutLicense);
  languageChange();
  resize(QSize(367, 444).expandedTo(minimumSizeHint()));
  clearWState(WState_Polished);

  // signals and slots connections
  connect(mpBtnLicense, SIGNAL(clicked()), this, SLOT(slotViewLicense()));
  init();
}

/*
 *  Destroys the object and frees any allocated resources
 */
CQSplashWidget::~CQSplashWidget()
{
  // no need to delete child widgets, Qt does it all for us
}

/*
 *  Sets the strings of the subwidgets using the current
 *  language.
 */
void CQSplashWidget::languageChange()
{
  setCaption(tr("Form1"));
  mpLblVersion->setText(tr("<h1 style=\"color:#000088;\">Version %1</h1>"));
  mpLblLicense->setText(tr("<p style=\"color:#000088;\">The use of this software indicates the acceptance of the attached license.</p>"));
  mpBtnLicense->setText(tr("View License"));
}
